if (typeof pokeSettings === 'undefined') {
    pokeSettings = null;
}
if (typeof selectBackground === 'undefined') {
    selectBackground = null;
}
results = [];

// run on first load
readSettgings();
setMainSettings();
changeBackground();

function pick() {
    const [min, max, allowDuplicates] = [pokeSettings.start, pokeSettings.end, pokeSettings.allowDuplicates];

    let result = Math.floor(Math.random() * (max - min + 1)) + min;

    // 不可以重复 && 选到了重复的数字 => 从没选到的数字里选一个
    if (!allowDuplicates && (results.includes(result))) {
        const availableNumbers = Array.from({ length: max - min + 1 }, (_, i) => i + min)
            .filter(num => !results.includes(num));

        // 没有不重复的数字了
        if (availableNumbers.length === 0) {
            return null;
        }

        result = availableNumbers[result % availableNumbers.length];
    }

    results.push(result);

    return result;
}

function reset() {
    results = [];

    for (const digitEl of document.querySelectorAll(".game_item ul")) {
        digitEl.style = null;
    }

    const resultEl = document.getElementById("result");
    if (resultEl) {
        resultEl.innerText = '';
    }
}

function setResults() {
    const resultEl = document.getElementById("result");

    const newRestulEl = document.createElement("div");
    newRestulEl.innerText = results[results.length - 1],

        resultEl.appendChild(newRestulEl);
}

function readSettgings() {
    if (pokeSettings === null) {
        pokeSettings = JSON.parse(localStorage.getItem("pokeSettings"));
        if (pokeSettings === null) {
            // default
            pokeSettings = {
                title: '',
                start: 0,
                end: 999999,
                allowDuplicates: true,
            }
        }
    }

    if (selectBackground === null) {
        selectBackground = localStorage.getItem("selectBackground");
        if (selectBackground === null) {
            // default
            selectBackground = "url(data:image/jpeg;base64,)"
        }
    }
}

function saveSettgings() {
    const title = document.getElementById("settings-title").value;
    let start = document.getElementById("settings-start").value;
    let end = document.getElementById("settings-end").value;
    const allowDuplicates = document.getElementById("settings-allow-duplicates").value === '1';

    if (isNaN(start) || isNaN(end) || start < 0 || start > 999999 || end < 0 || end > 999999) {
        console.log("抽选范围在 0 ~ 999999 之间");

        start = pokeSettings.start;
        end = pokeSettings.end;
        document.getElementById("settings-start").value = start;
        document.getElementById("settings-end").value = end;
    }

    pokeSettings = {
        title: title,
        start: Math.min(start, end),
        end: Math.max(start, end),
        allowDuplicates: allowDuplicates
    };

    localStorage.setItem("pokeSettings", JSON.stringify(pokeSettings));
}

function saveSelectBackground() {
    const files = document.getElementById('select-background-file')['files'];

    if (files.length > 0) {
        const reader = new FileReader();
        reader.onloadend = function () {
            selectBackground = `url(${reader.result})`;
            localStorage.setItem("selectBackground", selectBackground);

            changeBackground();
        };
        reader.readAsDataURL(files[0]);
    }
}

function changeBackground() {
    document.body.style.backgroundImage = selectBackground;
}

function setMainSettings() {
    document.getElementById("settings-title").value = pokeSettings.title;
    document.getElementById("settings-start").value = pokeSettings.start;
    document.getElementById("settings-end").value = pokeSettings.end;
    document.getElementById("settings-allow-duplicates").value = pokeSettings.allowDuplicates ? '1' : '2';
}

function setSelectTitle() {
    let titleLogo = pokeSettings.title;
    if (titleLogo === '') {
        titleLogo = "鬼屋到你";
    }
    document.getElementById("title-logo").text = titleLogo;
}

function gotoSelect() {
    document.documentElement.innerHTML = selectHtml;
    runScripts();

    setSelectTitle();
    changeBackground();
}

function gotoMain() {
    document.documentElement.innerHTML = indexHtml;
    runScripts();

    reset();
    setMainSettings();
    changeBackground();
}

function runScripts() {
    for (const script of document.querySelectorAll("script")) {
        if (script.src && !script.src.endsWith("js/app.js")) {
            const head = document.querySelector('head');
            const newScript = document.createElement('script');
            newScript.src = script.src;
            head.appendChild(newScript);
        } else {
            eval(script.innerText);
        }
    }
}

